import React from "react";
import { NavbarWrap } from "../../styles/components/Dashboard/NavbarStyle";
import {
  AiOutlineMenu,
  AiFillHome,
  AiTwotoneFire,
  AiTwotoneSetting,
} from "react-icons/ai";
import { MdLibraryBooks } from "react-icons/md";

export default function Navbar() {
  return (
    <NavbarWrap>
        <div className="iconReact">
      <AiOutlineMenu />

        </div>
        <div className="iconReact"></div>
        <div className="iconReact"></div>
        <div className="iconReact"></div>
        <div className="iconReact"></div>
      <AiFillHome />
      <AiTwotoneFire />
      <MdLibraryBooks />
      <AiTwotoneSetting />
    </NavbarWrap>
  );
}
